import React, { useState } from 'react';
import { InputText } from 'primereact/inputtext';
import { Calendar } from 'primereact/calendar';
import { Dropdown } from 'primereact/dropdown';
import { InputNumber } from 'primereact/inputnumber';
import { RadioButton } from 'primereact/radiobutton';
import { Button } from 'primereact/button';
import { InputTextarea } from 'primereact/inputtextarea';

const BookingForm = () => {
  const [formData, setFormData] = useState({
    companyName: '',
    contactName: '',
    contactEmail: '',
    eventDate: null,
    eventTime: null,
    eventType: '',
    otherFoodTrucks: 'no',
    attendees: 0,
    additionalInfo: ''
  });

  const eventTypes = [
    { label: 'Corporate', value: 'corporate' },
    { label: 'Wedding', value: 'wedding' },
    { label: 'Birthday', value: 'birthday' },
    { label: 'Festival', value: 'festival' },
    { label: 'Other', value: 'other' }
  ];

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
    alert('Booking request submitted with placeholder data!');
  };

  const styles = {
    container: {
      maxWidth: '600px',
      margin: '0 auto',
      padding: '20px',
      backgroundColor: '#F0F2E4', // Alabaster
      borderRadius: '8px',
      boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    },
    header: {
      color: '#DB0B00', // Rosso Corsa
      textAlign: 'center',
      marginBottom: '20px',
    },
    field: {
      marginBottom: '15px',
    },
    label: {
      display: 'block',
      marginBottom: '5px',
      color: '#DB0B00', // Rosso Corsa
      fontWeight: 'bold',
    },
    input: {
      width: '100%',
      padding: '8px',
      borderRadius: '4px',
      border: '1px solid #FFB4E1', // Light Hot Pink
      boxSizing: 'border-box',
    },
    radioGroup: {
      display: 'flex',
      gap: '10px',
    },
    button: {
      backgroundColor: '#DB0B00', // Rosso Corsa
      color: 'white',
      padding: '10px 20px',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
      fontSize: '16px',
    },
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.header}>Book Your Event</h2>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="companyName">Company Name</label>
        <InputText id="companyName" name="companyName" value={formData.companyName} onChange={handleChange} required style={styles.input} />
      </div>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="contactName">Contact Name</label>
        <InputText id="contactName" name="contactName" value={formData.contactName} onChange={handleChange} required style={styles.input} />
      </div>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="contactEmail">Contact Email</label>
        <InputText id="contactEmail" name="contactEmail" value={formData.contactEmail} onChange={handleChange} required style={styles.input} />
      </div>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="eventDate">Event Date</label>
        <Calendar id="eventDate" name="eventDate" value={formData.eventDate} onChange={(e) => setFormData({ ...formData, eventDate: e.value })} showIcon style={styles.input} />
      </div>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="eventTime">Event Time (Range)</label>
        <Calendar id="eventTime" name="eventTime" value={formData.eventTime} onChange={(e) => setFormData({ ...formData, eventTime: e.value })} timeOnly hourFormat="24" showTime style={styles.input} />
      </div>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="eventType">Event Type</label>
        <Dropdown id="eventType" name="eventType" value={formData.eventType} options={eventTypes} onChange={(e) => setFormData({ ...formData, eventType: e.value })} placeholder="Select Event Type" style={styles.input} />
      </div>

      <div style={styles.field}>
        <label style={styles.label}>Will there be other food trucks or food offered at the event?</label>
        <div style={styles.radioGroup}>
          <RadioButton inputId="otherFoodTrucksYes" name="otherFoodTrucks" value="yes" onChange={handleChange} checked={formData.otherFoodTrucks === 'yes'} />
          <label htmlFor="otherFoodTrucksYes">Yes</label>
          <RadioButton inputId="otherFoodTrucksNo" name="otherFoodTrucks" value="no" onChange={handleChange} checked={formData.otherFoodTrucks === 'no'} />
          <label htmlFor="otherFoodTrucksNo">No</label>
        </div>
      </div>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="attendees">Expected Number of Attendees</label>
        <InputNumber id="attendees" name="attendees" value={formData.attendees} onChange={(e) => setFormData({ ...formData, attendees: e.value })} required style={styles.input} />
      </div>

      <div style={styles.field}>
        <label style={styles.label} htmlFor="additionalInfo">Additional Information</label>
        <InputTextarea id="additionalInfo" name="additionalInfo" value={formData.additionalInfo} onChange={handleChange} style={styles.input} />
      </div>

      <Button label="Submit" icon="pi pi-check" onClick={handleSubmit} style={styles.button} />
    </div>
  );
};

export default BookingForm;
